import React from 'react';
import './Compare.css';

function Compare() {
    return (
        <div>
            <h1 className='tittle'>Compare O Melhor Colchão</h1>

            <div className='card'>
                <div className='image-placeholder'></div>
                <div className='card-content'>
                    <h2></h2>
                </div>
            </div>
        </div>
    );
}

export default Compare;
